     &   (F2*SB2*CKM(gno1,Ind2)*CKMC(gno2,Ind1)*
     &       Sub547(All5,Cha4,Ind1)*Sub563(All4,All5,Ind3,Ind4)*
     &       Sub564(All4,Cha4,Ind2) + 
     &      2*CB2*F1*CKM(gno1,Ind3)*CKMC(gno2,Ind4)*Mf(tH,gno1)*
     &       Mf(tH,gno2)*Sub571(All4,All5,Ind1,Ind2)*
     &       UASf(All5,Ind4,bH)*UASfC(All4,Ind3,bH)*VCha(Cha4,2)*
     &       VChaC(Cha4,2))/(CB2*SB2)

        Sub593(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   (F1*SB2*CKM(gno1,Ind2)*CKMC(gno2,Ind1)*
     &       Sub547(All5,Cha4,Ind1)*Sub563(All4,All5,Ind3,Ind4)*
     &       Sub564(All4,Cha4,Ind2) + 
     &      2*CB2*F2*CKM(gno1,Ind3)*CKMC(gno2,Ind4)*Mf(tH,gno1)*
     &       Mf(tH,gno2)*Sub571(All4,All5,Ind1,Ind2)*
     &       UASf(All5,Ind4,bH)*UASfC(All4,Ind3,bH)*VCha(Cha4,2)*
     &       VChaC(Cha4,2))/(CB2*SB2)

        Sub585(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   (F2*SB2*CKM(gno1,Ind2)*CKMC(gno2,Ind1)*
     &       Sub547(All5,Cha4,Ind1)*Sub564(All4,Cha4,Ind2)*
     &       Sub577(All4,All5,Ind3,Ind4) + 
     &      2*CB2*F1*CKM(gno1,Ind3)*CKMC(gno2,Ind4)*Mf(tH,gno1)*
     &       Mf(tH,gno2)*Sub584(All4,All5,Ind1,Ind2)*
     &       UASf(All5,Ind4,bH)*UASfC(All4,Ind3,bH)*VCha(Cha4,2)*
     &       VChaC(Cha4,2))/(CB2*SB2)

        Sub594(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   (F1*SB2*CKM(gno1,Ind2)*CKMC(gno2,Ind1)*
     &       Sub547(All5,Cha4,Ind1)*Sub564(All4,Cha4,Ind2)*
     &       Sub577(All4,All5,Ind3,Ind4) + 
     &      2*CB2*F2*CKM(gno1,Ind3)*CKMC(gno2,Ind4)*Mf(tH,gno1)*
     &       Mf(tH,gno2)*Sub584(All4,All5,Ind1,Ind2)*
     &       UASf(All5,Ind4,bH)*UASfC(All4,Ind3,bH)*VCha(Cha4,2)*
     &       VChaC(Cha4,2))/(CB2*SB2)

        Sub591(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   (F2*SB2*CKM(gno1,Ind2)*CKMC(gno2,Ind1)*
     &       Sub547(All5,Cha4,Ind1)*Sub564(All4,Cha4,Ind2)*
     &       Sub587(All4,All5,Ind3,Ind4) + 
     &      2*CB2*F1*CKM(gno1,Ind3)*CKMC(gno2,Ind4)*Mf(tH,gno1)*
     &       Mf(tH,gno2)*Sub590(All4,All5,Ind1,Ind2)*
     &       UASf(All5,Ind4,bH)*UASfC(All4,Ind3,bH)*VCha(Cha4,2)*
     &       VChaC(Cha4,2))/(CB2*SB2)

        Sub596(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   (F1*SB2*CKM(gno1,Ind2)*CKMC(gno2,Ind1)*
     &       Sub547(All5,Cha4,Ind1)*Sub564(All4,Cha4,Ind2)*
     &       Sub587(All4,All5,Ind3,Ind4) + 
     &      2*CB2*F2*CKM(gno1,Ind3)*CKMC(gno2,Ind4)*Mf(tH,gno1)*
     &       Mf(tH,gno2)*Sub590(All4,All5,Ind1,Ind2)*
     &       UASf(All5,Ind4,bH)*UASfC(All4,Ind3,bH)*VCha(Cha4,2)*
     &       VChaC(Cha4,2))/(CB2*SB2)

        Sub586(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   Sub572(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4)*
     &     XHiggs(hno,1,uzext1) - 
     &    Sub585(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4)*
     &     XHiggs(hno,2,uzext1)

        Sub595(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   Sub593(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4)*
     &     XHiggs(hno,1,uzext1) - 
     &    Sub594(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4)*
     &     XHiggs(hno,2,uzext1)

        Sub592(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   (3*cI*(CB*CW*Sub591(All4,All5,Cha4,Ind1,Ind2,Ind3,
     &          Ind4)*XHiggs(hno,3,uzext1)) + 
     &      Sub586(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4))/
     &    (CB*CW)

        Sub597(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   (3*cI*(CB*CW*Sub596(All4,All5,Cha4,Ind1,Ind2,Ind3,
     &          Ind4)*XHiggs(hno,3,uzext1)) + 
     &      Sub595(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4))/
     &    (CB*CW)

        Sub598(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   m2*pave16(PVC(cc1),All4,All5,Cha4)*
     &     Sub592(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) + 
     &    m3*pave16(PVC(cc2),All4,All5,Cha4)*
     &     Sub597(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4)

	ENDLOOP(All4)
	ENDLOOP(All5)
	ENDLOOP(Cha4)
	ENDLOOP(Ind1)
